import {ListUsers} from '../redux-constants';
import user from '../../controller/User'
export  const listUser = () => async dispatch => {
    try {
        dispatch({
            type: ListUsers.NOTE_LISTING_REQUEST
        });

        await user.getUsers();
        const respond = user.getResponse();
        if (respond) {
            dispatch({
                type: ListUsers.NOTE_LISTING_SUCCESS,
                payload: respond
            });
        } else {
            const { message } = respond;
            dispatch({
                type: ListUsers.NOTE_LISTING_FAIL,
                payload: message
            });
        }
    } catch (error) {
        dispatch({
            type: ListUsers.NOTE_LISTING_FAIL,
            payload: error
        });
    }
};
